<script>
  let seasons = ['2014/15', '2015/16', '2016/17', '2017/18', '2018/19']
  import { stadiums } from '../stadiums.js'
  import { stadiumsFull } from '../stadiums-full.js'

  let width = 600
  let x = -1000
  let y = -1000
  let name = ''
  let year1, year2, year3, year4, year5, capacity, team
  let av1, av2, av3, av4, av5
  let formatThousands = new Intl.NumberFormat()
  import { teams } from '../teams'

  function hover(event, target) {
    team = teams.filter((f) => f.code === target)[0].club

    x = event.clientX - 100
    y = event.clientY + 10

    name = stadiums.filter((d) => d.code === target)[0].stadium
    capacity = stadiums.filter((d) => d.code === target)[0].capacity

    // 2014/15
    if (
      stadiumsFull.filter((d) => d.code === target && d.season === '2014/15')[0]
    ) {
      year1 = stadiumsFull.filter(
        (d) => d.code === target && d.season === '2014/15'
